import React from 'react';
import s from './Users.module.css';

let Users = (props) => {

    return (
        <div>
            {
                props.users.map( u => <div key={u.id}>
                   <span>
                       <div>
                           <img src={u.photoUrl} className={s.usersPhoto}/>
                       </div>
                       <div>
                           <button onClick={() => follow(u.id)}>{u.followed ? <button>Unfollow</button> : <button>Follow</button>}</button>
                       </div>
                   </span>
                   <span>
                       <span>
                           <div>{u.fullname}</div>
                           <div>{u.status}</div>
                       </span>
                       <span>
                           <div>{u.location.city}</div>
                           <div>{u.location.country}</div>
                           <div></div>
                       </span>
                   </span>
                </div>)
            }
        </div>
    );
}

export default Users;
